import React from 'react'

function TodoList(todos) {
    console.log("TODOS HERE", todos)
  return (
    <div>
        <ListContainer>
            {todos?.map((todo) => (
                <Row key={todo._id}>
            <Text>
            {todo.text}
            </Text>
                </Row>
            ))}
        </ListContainer>
    </div>
  )
}

export default TodoList
